import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car insurance", amount: 250.8, date: new Date(2021, 2, 20) },
    { title: "Toilet paper", amount: 150.8, date: new Date(2021, 2, 21) },
    { title: "Car insurance", amount: 1150.8, date: new Date(2021, 2, 22) },
    { title: "Car insurance", amount: 270.8, date: new Date(2021, 2, 23) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
